export const users: any = {
  0: { name: 'Вася' },
  1: { name: 'Петя' },
  ['2']: { name: 'Вова' },
}

export const fetchUser = (id: string) =>
  new Promise((resolve, reject) =>
    setTimeout(() => {
      if (users.id) {
        resolve(users.id)
      }
      reject('Юзер не найден!')
    }, 1000),
  )
